import React from "react";
import { motion } from "framer-motion";
import styles from "./ContactMe.module.css";

import{ FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import{} from "@fortawesome/fontawesome-svg-core";
import{} from "@fortawesome/free-regular-svg-icons";
import {faBootstrap, faCss3, faFacebook, faGit, faGithub, faHtml5, faJs, faNodeJs, faReact} from "@fortawesome/free-brands-svg-icons";
const tiempo={
    inicial:{y:0},

        arriba:{
            y:-30,
        
        },
        abajo:{
            y:60,
         
        }
}
function ContactMe (){
   
const comprobar=()=>{
if(tiempo.inicial.y){
    tiempo.abajo.y
}else if(tiempo.abajo.y){
tiempo.arriba.y
}
}


return  ( 
<div className="containter">
<motion.div className={styles.box}
    animate={{
      scale: [1, 5, 5, 1, 1],
      rotate: [0, 0, 0, 0, 0],
      borderRadius: ["20%", "10%", "10%", "10%", "10%"],
    }}
    transition={{from:5, duration:3,repeat:Infinity}}
  > 
  </motion.div>
<motion.div
variants={tiempo} animate={comprobar}
>

<FontAwesomeIcon className="icono" icon={faCss3}/>
</motion.div>
<FontAwesomeIcon className={styles.icono} icon={faHtml5}/>

    <FontAwesomeIcon className="icono" icon={faJs}/>
    <FontAwesomeIcon className="icono" icon={faReact}/>
    <FontAwesomeIcon className="icono" icon={faBootstrap}/>
    <FontAwesomeIcon className="icono" icon={faGithub}/>
    <FontAwesomeIcon className="icono" icon={faNodeJs}/>
    <FontAwesomeIcon className="icono" icon={faGit}/>

</div>
        );
}
export default ContactMe;
